INSERT INTO `app_proyecto` VALUES (1,'Moda Productiva y competitiva I',0,'2017-09-15 15:27:32','7.3 Meses','En consorcio con la firma Avance Organizacional Consultores, asesoramos y brindamos herramientas para mejorar su productividad y competitividad a unidades productivas de las localidades de Restrepo y Tunjuelito, en la ciudad e Bogotá D.C., pertenecientes a los sectores moda, cuero, calzado y confecciones. Todo esto mediante la operación de los Centros de Servicio e Innovación Empresarial – CSEI, dispuestos por la Alcaldía Mayor de Bogotá D.C. en la localidades en mención.',' <p>Encuentros lúdico – empresariales sobre gestión del cambio.</br>\r\n                                          Talleres de fortalecimiento de habilidades empresariales.</br>\r\n                                          Rueda de negocios.</br>\r\n                                          Diagnóstico.</b','proyectos/01_alcaldia_bogot.jpg',225,1,1,12,450,'img/logos/34_analdex.png','img/logos/02_logo_bogota_mejor_todos.png','2021-04-27 15:30:02','2021-04-29 16:28:56','moda-productiva-y-competitiva-i',NULL,20),(2,'Productividad empresarial rural en empresas de turismo rural, café, cacao y hortofrutícolas',1900,'2018-02-14 15:31:17','14.7 Meses','En consorcio con la Fundación del Alto Magdalena y en alianza con la Fundación Amanecer, realizamos el fortalecimiento, en áreas como mercadeo, producción, planeación, creación de valor e innovación, a unidades productivas en entornos rurales de los sectores turismo, cacao, café y hortofrutícola, mejorando su productividad en un 8% o más.',' <p>\r\n                                          Diagnóstico.</br>\r\n                                          Plan de acción.</br>\r\n                                          2 Soluciones empresariales.</br>\r\n                                          Asesoría en core de negocio.</p>','proyectos/02_alcaldia_bogot.jpg',375,10,83,54,750,'img/03_alto_magadalena_y_fundacion_amanecer.png','img/logos/03_fiducoldexColombiaProductiva.png','2021-04-27 15:34:59','2021-04-29 16:29:14','productividad-empresarial-rural-en-empresas-de-tur',NULL,22),(3,'Moda productiva y competitiva II',1930,'2018-06-27 15:34:59','5.1 Meses','En consorcio con la firma Avance Organizacional Consultores, asesoramos y brindamos herramientas para mejorar su productividad y competitividad a unidades productivas de las localidades de Restrepo y Tunjuelito, en la ciudad e Bogotá D.C., pertenecientes a los sectores moda, cuero, calzado y confecciones. Todo esto mediante la operación de los Centros de Servicio e Innovación Empresarial – CSEI, dispuestos por la Alcaldía Mayor de Bogotá D.C. en la localidades en mención.',' <p>Diagnóstico.</br>\r\n                                          Talleres de fortalecimiento de habilidades empresariales.</br>\r\n                                          Asistencia técnica en temas de producción y comercialización.</p>','proyectos/03_FIDUCOLDEX.jpg',100,1,1,12,200,'img/04_logo_avance_organizacional.png','img/logos/04_logo_bogota_mejor_todos.png','2021-04-27 15:36:51','2021-04-29 16:29:44','moda-productiva-y-competitiva-ii',NULL,23),(4,'Herramientas de marketing digital en el sector turismo',1900,'2018-08-21 15:36:52','11.1 Meses','En consorcio con PI Interactiva, capacitamos a empresas del sector turismo, ubicadas en entornos rurales de los departamentos de Chocó, Magdalena y Tolima, para desarrollar competencias que les permitieran implementar una estrategia de marketing digital con el fin de ampliar su presencia internacional y tener acceso a nuevos mercados a través de herramientas digitales y canales disponibles para ello.','<p>Diagnóstico.</br>\r\n                                          Talleres fortalecimientos competencias digitales.</br>\r\n                                          Estrategia de marketing digital.</br>\r\n                                          Evaluación de impacto.</p>','proyectos/05_FIDUCOLDEX.jpg',48,3,6,6,144,'img/04_pi_interactiva.png','img/logos/05_fiducoldexColombiaProductiva.png','2021-04-27 15:39:36','2021-04-29 16:30:04','herramientas-de-marketing-digital-en-el-sector-tur',NULL,24),(5,'Ruta de Internacionalización de Bogotá - RIBE',1600,'2018-07-26 15:40:24','6.1 Meses','En consorcio con la Asociación Nacional de Comercio Exterior - ANALDEX, desarrollamos un proceso de fortalecimiento empresarial orientado a la internacionalizaciòn de un grupo de empresas exportadoras o con potencial exportador de la ciudad de Bogotà D.C., de los sectores salud, agroindustria, industrias en movimiento, cosméticos, calzado, cuero y moda.','<p>\r\n                                          Diagnóstico capacidad exportadora.</br>\r\n                                          Plan de internacionalzación.</br>\r\n                                          Asistencia técnica para fortalecer procesos de venta en el exterior.</p>','proyectos/02_alcaldia_bogot_VQ7xe5X.jpg',45,1,1,8,90,'img/logos/34_analdex.png','img/logos/02_logo_bogota_mejor_todos.png','2021-04-27 15:43:19','2021-04-30 22:22:35','ruta-de-internacionalizacion-de-bogota-ribe',NULL,21),(6,'Fábricas de productividad  - Especial Microempresas',1930,'2019-09-01 15:43:38','10 Meses','En joint venture con la Asociación Colombiana de Pequeños Industriales – ACOPI, operamos el proyecto Fábricas de Productividad - Especial Microempresas, apoyando el desarrollo metodológico de la herramienta automatizada de diagnóstico de las microempresas y el modelo de consultoría asociado, así como la implementación de los mismos en microempresas de agroindustria, manufactura y servicios,  que le permitió mejorar su productividad, en promedio, en un 8% o más.','  <p>Diagnóstico.</br>\r\n                                          Plan de trabajo.</br>\r\n                                          2 Soluciones empresariales.</p>','proyectos/06_ACOPI.jpg',280,9,20,56,560,'img/06_soluciones_socialmente_sostenibles.png','img/logos/06_Acopi_fiducoldexColombiaProductiva.png','2021-04-27 15:46:03','2021-04-29 16:31:03','fabricas-de-productividad-especial-microempresas',NULL,25),(7,'Asistencia técnica planes de negocio programas de desarrollo y paz',1600,'2020-06-10 15:46:03','4 Meses','Apoyamos la ruta construida para la consolidación de las iniciativas de sostenibilidad financiera de los Programas de Desarrollo y Paz - PDP y de la Redprodepaz, desde un asesoramiento especializado en planes y modelos de negocio. Las iniciativas estaban relacionadas con negocios de producción, transformación y  comercialización de productos agropecuarios, y la prestación de servicios ambientales.',' <p> Diagnóstico.</br>\r\n                                          Viabilidad técnica.</br>\r\n                                          Viabilidad financiera.</br>\r\n                                          Modelo de negocio. </br>\r\n                                          Figura jurídica. </br>\r\n                                          Estudio de mercado. </br>\r\n                                          Estrategia de mercadeo.</p>','proyectos/07_GIZ.jpg',13,12,13,18,39,'img/06_soluciones_socialmente_sostenibles.png','img/logos/07_Giz_Agencia_coperacion_alemana.png','2021-04-27 15:48:00','2021-04-29 16:31:47','asistencia-tecnica-planes-de-negocio-programas-de-',NULL,28),(8,'Fortalecimiento a la Red Nacional Académica de Tecnología Avanzada I',1900,'2017-10-23 15:48:01','3.1 Meses','Realizamos un acompañamiento a la Red Nacional Académica de Tecnología Avanzada – RENATA en asuntos estratégicos.',' <p>Proyección financiera y operativa.</br>\r\n                                          Análisis oferta comercial.</br>\r\n                                          Construcción de caso de negocio.</p>','proyectos/08_renata.jpg',1,1,1,2,5,'','img/logos/08_Renata.png','2021-04-27 15:49:58','2021-04-29 16:32:26','fortalecimiento-a-la-red-nacional-academica-de-tec',NULL,29),(9,'Fortalecimiento a la Red Nacional Académica de Tecnología Avanzada II',1930,'2018-01-26 15:49:59'