 de la Corporación</br>\r\n                                          Pricing.</br>\r\n                                          Prospección de clientes.</p>','proyectos/11_renata.jpg',1,1,1,2,5,'','img/logos/11_Renata.png','2021-04-27 15:57:10','2021-05-03 14:32:50','fortalecimiento-a-la-red-nacional-academica-de-tec',NULL,32),(12,'Fortalecimiento a la Red Nacional Académica de Tecnología Avanzada III',1600,'2019-09-05 15:57:11','1.9 Meses','Realizamos un acompañamiento a la Red Nacional Académica de Tecnología Avanzada – RENATA en asuntos de  fortalecimiento empresarial, comerciales, operativos y de proyectos de la Corporación Red Nacional Académica de Tecnología Avanzada – RENATA- en especial los que se deriven del contrato interadministrativo No. 1-0140 de 2019 celebrado con el SENA.','   <p>Proyección financiera y operativa.</br>\r\n                                          Presupuesto de la Corporación.</br>\r\n                                          Informe de gestión.</p>','proyectos/12_renata.jpg',1,1,1,2,5,'img/logos/12_Renata.png','','2021-04-27 16:04:20','2021-05-03 14:33:12','fortalecimiento-a-la-red-nacional-academica-de-tec',NULL,33),(13,'Fortalecimiento a la Red Nacional Académica de Tecnología Avanzada III',1900,'2019-11-19 16:04:20','1.4 Meses','Realizamos un acompañamiento a la Red Nacional Académica de Tecnología Avanzada – RENATA en el desarrollo de los procesos que requiera la representación legal de la Corporación Red Nacional Académica de Tecnología, avanzada - RENATA',' <p>Proyección financiera y operativa.</br>\r\n                                          Presupuesto de la Corporación.</br>\r\n                                          Seguiemiento a negociación con Telefónica.</br>\r\n                                          Plan de mejoramiento.</p>','proyectos/13_renata.jpg',1,1,1,2,5,'','img/logos/13_Renata.png','2021-04-27 16:06:15','2021-05-03 14:33:32','fortalecimiento-a-la-red-nacional-academica-de-tec',NULL,34),(14,'Fortalecimient